import React, { useState } from 'react';
import './PostcardCanvas.scss';

// Define what a submitted postcard looks like
interface PostcardData {
  id: number;
  city: string;
  name: string;
  imageUrl: string;
  // We store random positions so they stay put on the canvas
  xPos: number;
  yPos: number;
  rotation: number;
}

const PostcardCanvas = () => {
  // --- STATE ---
  // 1. The list of all submitted postcards on the canvas
  const [cards, setCards] = useState<PostcardData[]>([]);

  // 2. The current form inputs
  const [formData, setFormData] = useState({
    city: '',
    name: '',
    imageUrl: ''
  });

  // --- HANDLERS ---
  const handleInputChange = (e: React.ChangeEvent<HTMLInputElement>) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = () => {
    // Basic validation
    if (!formData.city || !formData.name) return;

    const newCard: PostcardData = {
      id: Date.now(),
      city: formData.city,
      name: formData.name,
      imageUrl: formData.imageUrl || 'https://picsum.photos/300/500', // Fallback image if empty
      // Random positioning within the canvas (0-80% to avoid overflow)
      xPos: Math.random() * 80,
      yPos: Math.random() * 60,
      // Slight random rotation for "scattered" feel (-15 to +15 degrees)
      rotation: (Math.random() - 0.5) * 30
    };

    setCards([...cards, newCard]);
    // Reset form
    setFormData({ city: '', name: '', imageUrl: '' });
  };

  return (
    <div className="postcard-canvas-container" id="postcard-canvas">
      <h2 className="canvas-title">PostCards from Around the World</h2>

      {/* TOP SECTION: THE CANVAS */}
      <div className="canvas-board">
        {cards.length === 0 && (
            <div className="canvas-placeholder-text">
                The canvas is empty. Be the first to post!
            </div>
        )}
        {cards.map((card) => (
          <div 
            key={card.id}
            className="postcard-stamp on-canvas"
            style={{
              left: `${card.xPos}%`,
              top: `${card.yPos}%`,
              transform: `rotate(${card.rotation}deg)`,
              zIndex: Math.floor(card.yPos) // Simple depth sorting based on Y position
            }}
          >
             <div 
               className="postcard-image" 
               style={{ backgroundImage: `url(${card.imageUrl})` }} 
             />
             <div className="postcard-text">
               <div className="city-name">{card.city}</div>
               <div className="user-name">from {card.name}</div>
             </div>
          </div>
        ))}
      </div>

      {/* BOTTOM SECTION: CREATION ZONE */}
      <div className="creation-zone">

        {/* LEFT: LIVE PREVIEW */}
        <div className="preview-container">
           <h3>Preview</h3>
           {/* This matches the structure of the canvas cards exactly */}
           <div className="postcard-stamp">
              <div 
                 className="postcard-image" 
                 // Show placeholder if input is empty
                 style={{ backgroundImage: `url(${formData.imageUrl || 'https://via.placeholder.com/300x500?text=Enter+Image+URL'})` }} 
              />
              <div className="postcard-text">
                 <div className="city-name">{formData.city || "City Name"}</div>
                 <div className="user-name">from {formData.name || "Your Name"}</div>
              </div>
           </div>
        </div>

        {/* RIGHT: INPUT FORM */}
        <div className="form-container">
            <input 
              name="city"
              className="stamp-input"
              placeholder="Insert city name" 
              value={formData.city}
              onChange={handleInputChange}
              maxLength={20}
            />
            <input 
              name="name"
              className="stamp-input"
              placeholder="Insert your name" 
              value={formData.name}
              onChange={handleInputChange}
              maxLength={20}
            />
            <input 
              name="imageUrl"
              className="stamp-input"
              placeholder="Paste link of image of city" 
              value={formData.imageUrl}
              onChange={handleInputChange}
            />
            <button 
                className="submit-stamp-btn" 
                onClick={handleSubmit}
                disabled={!formData.city || !formData.name}
            >
                Post to Canvas
            </button>
        </div>

      </div>
    </div>
  );
};

export default PostcardCanvas;
